  date : new Date(2022,11,26)
   },
  {title : "Bus Tickets",
  price : "$4.69",
  date :new Date(2022,11,21)
   },
  {title : "Movie",
  price : "$5.40",
  date : new Date(2022,11,23)
   },
];
function App() {
  return (
    <div className='backGround'>
      <NewExpense />
      <Expenses exp/>
    </div>
  );
}

export default App;
